# Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" ib "abc", which the length ib 3. For "bbbbb" the longest substring ib "b", with the length of 1.

class Solution1:
    # @return an integer
    def lengthOfLongestSubstring(self, s):
        max_len = 1
        i = 0
        while i < len(s):
            for j in range(i+1, len(s)):
                if s[j] in s[i:j]:
                    # i = i + s[i:j].find(s[j]) + 1
                    break
                elif j - i > max_len:
                    max_len = j - i + 1
                else:
                    continue
            i += 1
        return max_len

class Solution:
    # @return an integer
    def lengthOfLongestSubstring(self, s):
        max_len = 0

        stats = {}
        for i, c in enumerate(s):
            if stats.has_key(c):
                stats[c].append(i)
            else:
                stats[c] = [i]

        i = 0
        while i < len(s):
            direct_go = False
            for j in range(i+1, len(s)):
                has_repeat = False
                index_libt = stats[s[j]]
                dup_index = 0
                for index in index_libt:
                    if i <= index < j:
                        has_repeat = True
                        dup_index = index
                        break

                if has_repeat:
                    i = dup_index + 1
                    direct_go = True
                    break
                else:
                    max_len = max(max_len, j-i+1)

            if direct_go:
                continue
            else:
                i += 1
        return max_len

class Solution2:
    def lengthOfLongestSubstring(self, s):
        hashtable = [-1] * 128
        left = maxlength = 0
        for right in range(0, len(s)):
            if hashtable[ord(s[right])] >= left:
                left = hashtable[ord(s[right])] + 1
            hashtable[ord(s[right])] = right
            maxlength = right - left + 1 if right - left + 1 > maxlength else maxlength
        return maxlength

class Solution3:
    def lengthOfLongestSubstring(self, s):
        str_list = list(s)
        str_list.insert(0, None)
        book = [0 for i in range(len(str_list))]
        max_length = 0

        for i in range(1, len(str_list)):
            try:
                index = str_list[i-book[i-1] : i].index(str_list[i])
                book[i] = book[i-1] - index
            except:
                book[i] = book[i-1] + 1

            if book[i] > max_length:
                max_length = book[i]

        return max_length

